//
// magic attributes
//

// Set the selected
$(document).ready(function(){

    $("select[data-selected]").each(function(){
        var el = $(this);
        var el_value = el.data("selected");

        if (el_value !== "" && el_value !== undefined) {
            el.children("option").removeAttr("selected");

            el.children("option").each(function(){
                var option = $(this);
                if ( $.trim(""+option.val()) == $.trim(""+el_value) ) {
                    option.attr("selected", "selected");
                    return;
                }
            });
        }

        el.trigger("change");
    });
});

// Set the selected for multiples select
$(document).ready(function(){
    $("select[data-multiple-selected]").each(function(){
        var el = $(this);
        var el_value = el.data("multiple-selected");
        var ar_el_values = [];

        $.each(el_value.split(","), function(index, value){
            ar_el_values.push( $.trim(value) );
        });

        if (el_value !== "" && el_value !== undefined) {
            el.children("option").removeAttr("selected");

            el.children("option").each(function(){
                var option = $(this);

                if ( $.inArray($.trim(""+option.val()), ar_el_values) !== -1  ) {
                    option.attr("selected", "selected");
                    return;
                }
            });
        }

        el.trigger("change");
    });
});

// Set the selected
$(document).ready(function(){
    $("input[data-checked]").each(function(){
      var el = $(this);
      var value = $.trim( el.data("checked"));

      if (value !== "" && value !== "false" && value !== "null" && value !== "0" && value !== "off" && value !== "no" && value !== "nao" && value !== "não") {
        el.prop("checked", "checked");
      }

      el.trigger("change");
    });
});

// select2
$(document).ready(function(){
    $("select[data-select]").select2({ width: '100%', dropdownAutoWidth : true });
});


// datepicker
$(document).ready(function(){
    $("*[data-datepicker]").each(function(){
        var el = $(this);

        var picker = new Pikaday({
            field: el.get(0),
            format: 'DD/MM/YYYY'
        });
    });
});


// table
$(document).ready(function(){
    $("*[data-table]").each(function(){
	
        var el = $(this);
		//abaixo é se quiser separar o data table da tabela colocando numa div envolvendo a tabela
		//var el = $(this).find("table");
        $.fn.dataTable.moment( 'DD/MM/YYYY' );
        $.fn.dataTable.moment( 'DD/MM/YY' );
        $.fn.dataTable.moment( 'DD/MM/YYYY HH:mm:ss' );

        var options = {
            "pageLength": 50,
            "aaSorting": [],
            "language": {
                "sEmptyTable": "Nenhum registro encontrado",
                "sInfo": "Mostrando de _START_ a _END_ de _TOTAL_ registros",
                "sInfoEmpty": "Nenhum registro encontrato",
                "sInfoFiltered": "(Filtrados de _MAX_ registros)",
                "sInfoPostFix": "",
                "sInfoThousands": ".",
                "sLengthMenu": "_MENU_",
                "sLoadingRecords": "Carregando...",
                "sProcessing": "Processando...",
                "sZeroRecords": "Nenhum registro encontrado",
                "sSearch": "Pesquisar",
                "oPaginate": {
                    "sNext": "Proximo",
                    "sPrevious": "Anterior",
                    "sFirst": "Primeiro",
                    "sLast": "Ultimo"
                },
                "oAria": {
                    "sSortAscending": ": Ordenar colunas de forma ascendente",
                    "sSortDescending": ": Ordenar colunas de forma descendente"
                }
            }
        };

        if (el.data("rows") !== undefined) {
          options["pageLength"] = el.data("rows");
        }

        el.dataTable(options);

        if (el.data("table-tool") !== undefined || el.data("table-tools") !== undefined) {
            if (el.data("table-tool-swf-path") !== undefined)
                var tt = new $.fn.dataTable.TableTools( el, {"sSwfPath": el.data("table-tool-swf-path").replace("copy_csv_xls_pdf.swf", "").replace("/copy_csv_xls_pdf.swf", "") + "/copy_csv_xls_pdf.swf", "aButtons":    [ "xls", "pdf" ]} );
            else
                var tt = new $.fn.dataTable.TableTools( el, {"aButtons":    [ "xls", "pdf" ]} );

            $( tt.fnContainer() ).insertBefore(el);
        }
    });
});







